
var KalturaMessageTemplateService={get:function(messageType){var kparams=new Object();kparams.messageType=messageType;return new KalturaRequestBuilder("messagetemplate","get",kparams);},update:function(messageType,template){var kparams=new Object();kparams.messageType=messageType;kparams.template=template;return new KalturaRequestBuilder("messagetemplate","update",kparams);}}